import { Fragment } from 'react';
import {Route, Switch} from 'react-router-dom';
import './App.css';
import SignInPage from './Pages/SignInPage';

function App() {
  return (
      <Fragment>
        <Switch>
          <Route path="/" exact render={SignInPage}/>
        </Switch>
      </Fragment>
  );
}

export default App;
